import React, { useEffect, useState } from "react";
import axios from "axios";
import "./courses.css";
import AppTechTell from "./AppTechTell.png";

const CoursesCard = () => {
  const [productData, setProductData] = useState([]);

  useEffect(() => {
    const fetchProductData = async () => {
      try {
        const response = await axios.get("http://localhost:8000/api/products");
        setProductData(response.data);
      } catch (error) {
        console.error("Error fetching product data:", error);
      }
    };

    fetchProductData();
  }, []);

  return (
    <div className="flex flex-wrap justify-center">
      {productData.map((val, idx) => (
        <div
          key={idx}
          className="card-container my-5 mx-5 bg-gray-100 rounded-3xl border-solid border-2 border-gray-300 hover:shadow-2xl transition duration-300"
        >
          <div className="content p-4">
            <div className="image-wrapper mb-4">
              <img
                className="rounded-lg w-full h-40 object-cover"
                src={val.imageLink}
                alt={val.imageName}
              />
            </div>
            <div className="text-center">
              <h1 className="text-lg font-semibold mb-2">{val.imageName}</h1>
              <div className="details mb-4">
                <div className="flex justify-around my-2 items-center">
                  <div className="teacher-avatar mr-2">
                    <img className="h-8 w-8 rounded-full" src={AppTechTell} />
                  </div>
                  <div className="teacher-details">
                    <h4 className="text-sm font-medium">AppTechtell</h4>
                    <span className="text-xs text-gray-500">{val.hours}</span>
                  </div>
                </div>
              </div>
              <div className="rating flex justify-center items-center mb-4">
                <span className="text-yellow-400 mr-1">
                  <i className="fas fa-star"></i>
                </span>
                <span className="text-yellow-400 mr-1">
                  <i className="fas fa-star"></i>
                </span>
                <span className="text-yellow-400 mr-1">
                  <i className="fas fa-star"></i>
                </span>
                <span className="text-yellow-400 mr-1">
                  <i className="fas fa-star"></i>
                </span>
                <span className="text-yellow-400">
                  <i className="fas fa-star"></i>
                </span>
                <span className="text-gray-600 ml-1">({val.starsCount})</span>
              </div>
              <div className="buttons flex justify-around mb-4">
                <a href={val.link1} target="_blank" rel="noopener noreferrer">
                  <button className="btn bg-blue-500 hover:bg-blue-600 text-white px-4 py-2 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-400 focus:ring-opacity-75">
                    About
                  </button>
                </a>
                <a href={val.link2} target="_blank" rel="noopener noreferrer">
                  <button className="btn bg-blue-500 hover:bg-blue-600 text-white px-4 py-2 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-400 focus:ring-opacity-75">
                    Road Map
                  </button>
                </a>
                <a href={val.link3} target="_blank" rel="noopener noreferrer">
                  <button className="btn bg-blue-500 hover:bg-blue-600 text-white px-4 py-2 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-400 focus:ring-opacity-75">
                    Other
                  </button>
                </a>
              </div>
              <a
                href={val.youtubeVideoURL}
                target="_blank"
                rel="noopener noreferrer"
              >
                <div className="start-btn bg-blue-500 hover:bg-blue-600 text-white px-4 py-2 rounded-lg text-center cursor-pointer focus:outline-none focus:ring-2 focus:ring-blue-400 focus:ring-opacity-75">
                  START NOW!
                </div>
              </a>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default CoursesCard;
